import React from 'react';
import LeftNav from '../../../components/leftNav';
import InfoCard from '../../../components/infocard';
import InfoCardSkills from '../../../components/infocard/skills';
import TreeItem from '../../../components/treeItem';
import ImgPostPublic from '../../../components/imgPostPublic';


export default class PublicHome extends React.Component {
    render() {
      return (

        <div>
            <div className="row">

            <div className="col s3">
                <TreeItem img="100008343750912" name="Adam Donatelli" location="St. Petersburg" bornYear="1983"/>
                <LeftNav/>
                <InfoCard location='St. Petersburg'
                    age='35'
                    education='University of Arizona'
                    bornIn="Hobbs,NM"
                    />
                <InfoCardSkills/>
            </div>

            <div className="col s5">
                <ImgPostPublic 
                post="https://photos.smugmug.com/Test/i-J6mRXp2/0/6d0fc701/S/phoenixvaca-S.jpg"
                />
                <ImgPostPublic 
                post="https://photos.smugmug.com/Test/i-MkMvn4H/0/31787075/S/worker-S.jpg"
                />




            </div>


            <div className="col s4">
            <p>what </p> 
            </div>

            </div>
        </div>

    );
 }
}
